import React from 'react';

const Nav = () => {
    return (
    <div className='home-header-container-nav'>
        <div className="home-header-container-nav-left">
            <div className="branding">
                <img src="" alt="logo" />
            </div>
        </div>
        <div className="home-header-container-nav-right"></div>
    </div>
    );
};

export default Nav;
